import React from 'react';

class frominput extends React.Component{
    render(){
        const {handlercancel} = this.props
        return(
            <div>
                <p>Create Data</p>
                <label>Initial</label>
                <input type="text"/> <br />

                <label>Name</label>
                <input type="text"/> <br/>

                <label>Active</label>
                <input type="checkbox"/><br/>

                <button>Save Change</button>
                <button onClick={handlercancel}>Cancel</button>

            </div>
        )
    }
}
export default frominput;
